- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 1
  verse_text: Καὶ οὗτοι οἱ σταθμοὶ τῶν υἱῶν Ἰσραὴλ, ὡς ἐξῆλθον ἐκ γῆς Αἰγύπτου σὺν
    δυνάμει αὐτῶν ἐν χειρὶ Μωυσῆ καὶ Ἀαρών.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 2
  verse_text: Καὶ ἔγραψε Μωυσῆς τὰς ἀπάρσεις αὐτῶν, καὶ τοὺς σταθμοὺς αὐτῶν, διὰ ῥήματος
    Κυρίου· καὶ οὗτοι σταθμοὶ τῆς πορείας αὐτῶν.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 3
  verse_text: Ἀπῆραν ἐκ Ῥαμεσσὴ τῷ μηνὶ τῷ πρώτῳ, τῇ πεντεκαιδεκάτῃ ἡμέρᾳ τοῦ μηνὸς
    τοῦ πρώτου· τῇ ἐπαύριον τοῦ πάσχα ἐξῆλθον οἱ υἱοὶ Ἰσραὴλ ἐν χειρὶ ὑψηλῇ ἐναντίον
    πάντων τῶν Αἰγυπτίων.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 4
  verse_text: Καὶ οἱ Αἰγύπτιοι ἔθαπτον ἐξ αὐτῶν τοὺς τεθνηκότας πάντας οὓς ἐπάταξε
    Κύριος, πᾶν πρωτότοκον ἐν γῇ Αἰγύπτῳ· καὶ ἐν τοῖς θεοῖς αὐτῶν ἐποίησε τὴν ἐκδίκησιν
    Κύριος.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 5
  verse_text: Καὶ ἀπάραντες οἱ υἱοὶ Ἰσραὴλ ἐκ Ῥαμεσσῆ, παρενέβαλον εἰς Σοκχώθ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 6
  verse_text: Καὶ ἀπάραντες ἐκ Σοκχὼθ, παρενέβαλον εἰς Βουθὰν, ὅ ἐστι μέρος τι τῆς
    ἐρήμου·
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 7
  verse_text: Καὶ ἀπῇραν ἐκ Βουθὰν, καὶ παρενέβαλον ἐπὶ τὸ στόμα Εἰρὼθ, ὅ ἐστιν ἀπέναντι
    Βεελσεπφὼν, καὶ παρενέβαλον ἀπέναντι Μαγδώλου.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 8
  verse_text: Καὶ ἀπῇραν ἀπέναντι Εἰρὼθ, καὶ διέβησαν μέσον τῆς θαλάσσης εἰς τὴν ἔρημον·
    καὶ ἐπορεύθησαν ὁδὸν τριῶν ἡμερῶν διὰ τῆς ἐρήμου αὐτοὶ, καὶ παρενέβαλον ἐν Πικρίαις.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 9
  verse_text: Καὶ ἀπῇραν ἐκ Πικριῶν, καὶ ἦλθον εἰς Αἰλίμ· καὶ ἐν Αἰλὶμ δώδεκα πηγαὶ
    ὑδάτων, καὶ ἑβδομήκοντα στελέχη φοινίκων, καὶ παρενέβαλον ἐκεῖ παρὰ τὸ ὕδωρ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 10
  verse_text: Καὶ ἀπῇραν ἐξ Αἰλὶμ, καὶ παρενέβαλον ἐπὶ θάλασσαν ἐρυθράν.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 11
  verse_text: Καὶ ἀπῇραν ἀπὸ θαλάσσης ἐρυθρᾶς, καὶ παρενέβαλον εἰς τὴν ἔρημον Σίν.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 12
  verse_text: Καὶ ἀπῇραν ἐκ τῆς ἐρήμου Σὶν, καὶ παρενέβαλον εἰς Ῥαφακά.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 13
  verse_text: Καὶ ἀπῇραν ἐκ Ῥαφακὰ, καὶ παρενέβαλον ἐν Αἰλούς.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 14
  verse_text: Καὶ ἀπῇραν ἐξ Αἰλούς, καὶ παρενέβαλον ἐν Ῥαφιδίν· καὶ οὐκ ἦν ἐκεῖ ὕδωρ
    τῷ λαῷ πιεῖν.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 15
  verse_text: Καὶ ἀπῇραν ἐκ Ῥαφιδὶν, καὶ παρενέβαλον ἐν τῇ ἐρήμῳ Σινᾶ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 16
  verse_text: Καὶ ἀπῇραν ἐκ τῆς ἐρήμου Σινᾶ, καὶ παρενέβαλον ἐν μνήμασι τῆς ἐπιθυμίας.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 17
  verse_text: Καὶ ἀπῇραν ἐκ μνημάτων τῆς ἐπιθυμίας, καὶ παρενέβαλον ἐν Ἀσηρώθ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 18
  verse_text: Καὶ ἀπῇραν ἐξ Ἀσηρὼθ, καὶ παρενέβαλον ἐν Ῥαθαμᾷ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 19
  verse_text: Καὶ ἀπῇραν ἐκ Ῥαθαμᾶ, καὶ παρενέβαλον ἐν Ῥεμμὼν Φαρές.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 20
  verse_text: Καὶ ἀπῇραν ἐκ Ῥεμμὼν Φαρὲς, καὶ παρενέβαλον εἰς Λεβωνᾶ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 21
  verse_text: Καὶ ἀπῇραν ἐκ Λεβῶνα, καὶ παρενέβαλον εἰς Ῥεσσάν.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 22
  verse_text: Καὶ ἀπῇραν ἐκ Ῥεσσὰν, καὶ παρενέβαλον εἰς Μακελλάθ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 23
  verse_text: Καὶ ἀπῇραν ἐκ Μακελλὰθ, καὶ παρενέβαλον εἰς Σαφάρ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 24
  verse_text: Καὶ ἀπῇραν ἑκ Σαφὰρ, καὶ παρενέβαλον εἰς Χαραδάθ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 25
  verse_text: Καὶ ἀπῇραν ἐκ Χαραδὰθ, καὶ παρενέβαλον εἰς Μακηλώθ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 26
  verse_text: Καὶ ἀπῇραν ἐκ Μακηλὼθ, καὶ παρενέβαλον εἰς Καταάθ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 27
  verse_text: Καὶ ἀπῇραν ἐκ Καταὰθ, καὶ παρενέβαλον εἰς Ταράθ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 28
  verse_text: Καὶ ἀπῇραν ἐκ Ταρὰθ, καὶ παρενέβαλον εἰς Μαθεκκά.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 29
  verse_text: Καὶ ἀπῇραν ἐκ Μαθεκκὰ, καὶ παρενέβαλον εἰς Σελμωνᾶ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 30
  verse_text: Καὶ ἀπῇραν ἐκ Σελμωνᾶ, καὶ παρενέβαλον εἰς Μασουρούθ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 31
  verse_text: Καὶ ἀπῇραν ἐκ Μασουροὺθ, καὶ παρενέβαλον εἰς Βαναία.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 32
  verse_text: Καὶ ἀπῇραν ἐκ Βαναία, καὶ παρενέβαλον εἰς τὸ ὄρος Γαδγάδ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 33
  verse_text: Καὶ ἀπῇραν ἐκ τοῦ ὄρους Γαδγὰδ, καὶ παρενέβαλον εἰς Ἐτεβαθά.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 34
  verse_text: Καὶ ἀπῇραν ἐξ Ἐτεβαθὰ, καὶ παρενέβαλον εἰς Ἐβρωνά.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 35
  verse_text: Καὶ ἀπῇραν ἐξ Ἐβρωνὰ, καὶ παρενέβαλον εἰς Γεσιὼν Γάβερ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 36
  verse_text: Καὶ ἀπῇραν ἐκ Γεσιὼν Γάβερ, καὶ παρενέβαλον ἐν τῇ ἐρήμῳ Σίν· καὶ ἀπῇραν
    ἐκ τῆς ἐρήμου Σὶν, καὶ παρενέβαλον εἰς τὴν ἔρημον Φαράν· αὕτη ἐστὶ Κάδης.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 37
  verse_text: Καὶ ἀπῇραν ἐκ Κάδης, καὶ παρενέβαλον εἰς Ὢρ τὸ ὄρος πλησίον γῆς Ἐδώμ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 38
  verse_text: Καὶ ἀνέβη Ἀαρὼν ὁ ἱερεὺς διὰ προστάγματος Κυρίου, καὶ ἀπέθανεν ἐκεῖ
    ἐν τῷ τεσσαρακοστῷ ἔτει τῆς ἐξόδου τῶν υἱῶν Ἰσραὴλ ἐκ γῆς Αἰγύπτου, τῷ μηνὶ τῷ
    πέμπτῳ μιᾷ τοῦ μηνός.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 39
  verse_text: Καὶ Ἀαρὼν ἦν τριῶν καὶ εἴκοσι καὶ ἑκατὸν ἐτῶν, ὅτε ἀπέθνησκεν ἐν Ὢρ
    τῷ ὄρει.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 40
  verse_text: Καὶ ἀκούσας ὁ Χανανὶς βασιλεὺς Ἀρὰδ, καὶ οὗτος κατῴκει ἐν γῇ Χαναὰν,
    ὅτε εἰσεπορεύοντο οἱ υἱοὶ Ἰσραήλ·
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 41
  verse_text: καὶ ἀπῇραν ἐξ Ὢρ τοῦ ὄρους, καὶ παρενέβαλον εἰς Σελμωνᾶ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 42
  verse_text: Καὶ ἀπῇραν ἐκ Σελμωνᾶ, καὶ παρενέβαλον εἰς Φινώ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 43
  verse_text: Καὶ ἀπῇραν ἐκ Φινὼ, καὶ παρενέβαλον ἐν Ὠβώθ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 44
  verse_text: Καὶ ἀπῇραν ἐξ Ὠβὼθ, καὶ παρενέβαλον ἐν Γαῒ, ἐν τῷ πέραν ἐπὶ τῶν ὁρίων
    Μωάβ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 45
  verse_text: Καὶ ἀπῇραν ἐκ Γαῒ, καὶ παρενέβαλον εἰς Δαιβὼν Γάδ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 46
  verse_text: Καὶ ἀπῇραν ἐκ Δαιβὼν Γὰδ, καὶ παρενέβαλον ἐν Γελμὼν Δεβλαθαίμ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 47
  verse_text: Καὶ ἀπῇραν ἐκ Γελμὼν Δεβλαθαὶμ, καὶ παρενέβαλον ἐπὶ τὰ ὄρη τὰ Ἀβαρὶμ,
    ἀπέναντι Ναβαῦ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 48
  verse_text: Καὶ ἀπῇραν ἀπὸ ὀρέων Ἀβαρὶμ, καὶ παρενέβαλον ἐπὶ δυσμῶν Μωὰβ, ἐπὶ τοῦ
    Ἰορδάνου κατὰ Ἱεριχώ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 49
  verse_text: Καὶ παρενέβαλον παρὰ τὸν Ἰορδάνην ἀναμέσον Αἰσιμώθ, ἕως Βελσᾶ τὸ κατὰ
    δυσμὰς Μωάβ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 50
  verse_text: Καὶ ἐλάλησε Κύριος πρὸ; Μωυσῆν ἐπὶ δυσμῶν Μωὰβ παρὰ τὸν Ἰορδάνην κατὰ
    Ἱεριχὼ, λέγων,
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 51
  verse_text: λάλησον τοῖς υἱοῖς Ἰσραὴλ, καὶ ἐρεῖς πρὸς αὐτοὺς, ὑμεῖς διαβαίνετε τὸν
    Ἰορδάνην εἰς γῆν Χαναάν.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 52
  verse_text: Καὶ ἀπολεῖτε πάντας τοὺς κατοικοῦντας ἐν τῇ γῇ πρὸ προσώπου ὑμῶν, καὶ
    ἐξαρεῖτε τὰς σκοπιὰς αὐτῶν, καὶ πάντα τὰ εἴδωλα τὰ χωνευτὰ αὐτῶν ἀπολεῖτε αὐτὰ,
    καὶ πάσας τὰς στήλας αὐτῶν ἐξαρεῖτε.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 53
  verse_text: Καὶ ἀπολεῖτε πάντας τοὺς κατοικοῦντας τὴν γῆν, καὶ κατοικήσετε ἐν αὐτῇ,
    ὑμῖν γὰρ δέδωκα τὴν γῆν αὐτῶν ἐν κλήρῳ.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 54
  verse_text: Καὶ κατακληρονομήσετε τὴν γῆν αὐτῶν ἐν κλήρῳ κατὰ φυλὰς ὑμῶν· τοῖς πλείοσι
    πληθυνεῖτε τὴν κατάσχεσιν αὐτῶν, καὶ τοῖς ἐλάττοσιν ἐλαττώσετε τὴν κατάσχεσιν
    αὐτῶν· εἰς ὃ ἂν ἐξέλθῃ τὸ ὄνομα αὐτοῦ, ἐκεῖ αὐτοῦ ἔσται· κατὰ φυλὰς πατριῶν ὑμῶν
    κληρονομήσετε.
- book_title: μετάφραση των εβδομήκοντα ΑΡΙΘΜΟΙ 33
  book_usfm_code: NUM
  chapter_number: 33
  iso-639-2_language_code: grc
  verse_number: 55
